import React, { Component } from 'react';
import windowSize from 'react-window-size';

class Windowcheck extends Component {
  state = {
    screenSize: this.props.windowHeight
  }

  componentDidMount() {
    let subtotal = 0
    this.state.cartItems.forEach(p => (subtotal += p.price / 100) )
    this.setState({ subtotal })
  }

  render() {
    return (
      <h1>working</h1>
    );
  }
}

export default Windowcheck;
